description:
Astronauts: Lap of the Planet

Science Documentary hosted by Dermot O Leary, published by Channel 4 in 2014 - English narration


Information
------------------------------

Astronauts: Lap of the Planet
In this third and final part pioneering two hour live broadcast from the International Space Station and Mission Control in Houston, viewers can interact with the astronauts onboard the International Space Station 250 miles above Earth as they travel around the planet in 90 minutes, at speeds of up to 17,500 mph. The astronauts share their breathtaking views of Earth, with live links to English-speaking astronauts Rick Mastracchio and Koichi Wakata. On the ground, Dermot O'Leary and space veteran Mike Massimino - one of the astronauts who helped repair and upgrade the Hubble Telescope - are at the heart of Mission Control with the team who hold Rick and Koichi's lives in their hands. Also taking part are Professor Stephen Hawking and British astronaut Tim Peake, who is set to join the crew onboard the International Space Station in 2015.

